import s from './NewsSection.module.css';
import NewsList from './NewsList';

const NewsSection = () => {
	return (
		<div className={`${s.news} section-container`}>
			<div className={s.news_row}>
				<NewsList />
			</div>
		</div>
	);
};

export default NewsSection;
